function UserProfile() {
  const [username, setUsername] = useState('alaaahmade');


  return (
    <div className='UserProfile'>
      <div className="nav">
        <input type="text" className="search" value={username} 
        onChange={(e) => setUsername(e.target.value)}
        placeholder='Username' />
      </div>
    <UserCard/>
    </div>
  )
}

export default UserProfile
